import Client from "../client/client";

function user() {
  return {
    getProvinces: ({ params, payload }) => {
      const url = "api/v1/Provinces";
      return Client.get(url, payload, {});
    },
    getCities: ({ params, payload }) => {
      const url = "api/v1/Cities";
      return Client.get(url, payload, {});
    },
    search
  };
}

export default user();
